import React, { Component } from 'react';

class Loginpage extends Component
{
	login_procedure()
	{
		var b1 = document.getElementById("username");
		alert(b1);
	}
	
	render()
	{
		return(
			<React.Fragment>
			<div id="pagetitle">Treebase</div>
			<div id="div1" class="field">
			<div class="fieldname">Username</div>
			<input type="text" name="username" id="username" class="inputfield"/>
			</div>
			<div id="div2" class="field">
			<div class="fieldname">Password</div>
			<input type="text" name="password" id="password" class="inputfield"/>
			</div>
			<div id="loginbutton" onClick={this.login_procedure}>Log in</div>
			</React.Fragment>
		);
	}
}

export default Loginpage;
